import { Box, Typography } from '@mui/material';

function App() {
  return (
    <Box >
      <Box sx={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', marginTop: '50px', width: '600px' }} >
        <Typography>New Site!</Typography>
      </Box>
    </Box>
  );
}

export default App;
